import React from 'react';
import Products from '../Products';
import Courses from '../Courses';
const routes = [
	{
		path: '/product',
		exact: true,
		sidebar: () => <Products />,
	},
	{
		path: '/course',
		sidebar: <Courses />,
	},
];

export default routes;
